import React from 'react';





import AppLayout from '../components/AppLayout';
import PostForm from '../components/PostForm';
import PostCard from '../components/PostCard';
import useMe from '../hooks/useMe';
import useMainPosts from '../hooks/useMainPosts';
const Home = () => {


    const [me, setMe] = useMe();
    const [mainPosts, setMainPosts] = useMainPosts();
    // const { data: postData } = useSWR("dummyPostState", { initialData: dummyPost });

    // const [mainPosts, setMainPosts] = useState((postData || {}).mainPosts);
    // if (!postData) null;



    return (
        <AppLayout>

            {me && <PostForm />}
            {mainPosts.map((c) => {
                return (
                    <PostCard key={c.id} post={c} />
                );
            })}

        </AppLayout>
    );
};
export default Home;
